import React from 'react';
import taskStyle from '..//Tasks/Task/Task.module.css';

const Syllabus = props => {
  alert('inside Syllabus');
  return (
    <React.Fragment>
      <tr key={props.particularKey}>
        <td>
          <button className={taskStyle.delete} onClick={props.click}></button>
        </td>
        <td>
          <input
            className={taskStyle.inputStyle}
            type="text"
            onChange={props.changed}
            value={props.syllabusObj.name}
          />
        </td>

        <td>{props.syllabusObj.category.toString()}</td>
        <td>{props.syllabusObj.concentration.toString()}</td>
        <td>{props.syllabusObj.subject.toString()}</td>
        <td>{props.syllabusObj.source.toString()}</td>
        <td>{props.syllabusObj.syllabusCompletionTime.toString()}</td>
        <td>{props.syllabusObj.completionStatus.toString()}</td>
      </tr>
    </React.Fragment>
  );
};

export default Syllabus;
